<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>JSTLK Card</title>
  <style>
    :root {
      --neon: #00ff88;
      --neon-dim: #00dd77;
      --bg-dark: #0e0e0e;
      --card-bg: #1a1a1a;
      --cell-bg: #141414;
      --cell-border: #2aff96;
    }
    body {
      font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
      background-color: var(--bg-dark);
      color: var(--neon);
      display: flex;
      justify-content: center;
      align-items: flex-start;
      padding: 40px 20px;
      margin: 0;
    }
    .card-wrapper {
      transform: scale(0.85);
      transform-origin: top center;
      background-color: var(--card-bg);
      border: 6px solid var(--neon);
      border-radius: 14px;
      box-shadow: 0 0 20px #00ff8877;
      max-width: 640px;
      width: 100%;
      padding: 24px;
      text-align: center;
    }
    .header-row {
      display: grid;
      grid-template-columns: repeat(5, 1fr);
      margin-bottom: 12px;
      font-size: clamp(2.4rem, 6vw, 3.4rem);
      font-weight: 900;
      letter-spacing: 8px;
      color: var(--neon);
      text-shadow: 2px 2px #000;
      user-select: none;
    }
    .bingo-container {
      display: grid;
      grid-template-columns: repeat(5, 1fr);
      grid-template-rows: repeat(5, 100px);
      gap: 6px;
    }
    .bingo-cell {
      background-color: var(--cell-bg);
      color: #ffffff;
      border: 2px solid var(--cell-border);
      font-size: 1rem;
      display: flex;
      justify-content: center;
      align-items: center;
      padding: 6px;
      text-align: center;
      font-weight: 700;
      cursor: pointer;
      border-radius: 6px;
      transition: background-color 0.2s, color 0.2s, box-shadow 0.2s;
      overflow: hidden; /* default: contain content */
      position: relative;
    }
    .bingo-cell:hover {
      background-color: #1e1e1e;
      box-shadow: inset 0 0 0 2px var(--neon);
    }
    .bingo-cell.marked {
      background-color: var(--neon);
      color: #000;
      text-decoration: line-through;
    }
    /* Center (FREE) square tweaks */
    .bingo-cell.free {
      overflow: visible;          /* allow logo to overlap neighbors */
      cursor: default;            /* not clickable */
    }
    .bingo-cell.free img {
      width: 115%;                /* slightly oversized logo */
      height: auto;
      position: absolute;
      top: -38%;
      left: -8%;
      z-index: 2;
      pointer-events: none;       /* ignore clicks on the image */
      filter: drop-shadow(0 2px 6px rgba(0,0,0,0.5));
    }
    .controls {
      margin-top: 22px;
    }
    button {
      padding: 12px 26px;
      font-size: 1rem;
      font-weight: 800;
      background-color: var(--neon);
      color: #000;
      border: none;
      border-radius: 6px;
      cursor: pointer;
      box-shadow: 0 2px 8px rgba(0,0,0,0.4);
    }
    button:hover {
      background-color: var(--neon-dim);
    }
  </style>
</head>
<body>
  <div class="card-wrapper">
    <div class="header-row">
      <div>J</div><div>S</div><div>T</div><div>L</div><div>K</div>
    </div>
    <div class="bingo-container" id="bingoBoard"></div>
    <div class="controls">
      <button onclick="generateBoard()">New Card</button>
    </div>
  </div>
